import React, { Component } from 'react';
import './../App.css';

class Button extends Component {
    constructor(props) {
        super(props);
        this.gameStart = this.gameStart.bind(this);
    }

    gameStart() {
        console.log("Yeah!");
    }

    render() {
        return (
            <button onClick={this.gameStart()}>
                <h3>Start</h3>
            </button>
        );
    }
}

export default Button;
